/* eslint-disable jsx-a11y/alt-text */
import React, { useState, useEffect } from 'react'
import "./Resume.css"
import TopNav from "../../TopNav/TopNav"
import FooterBar from "../../FooterBar/FooterBar"
import Experience from "../../Resources/experience.png"
export default function Resume() {

    const [imagesSize, setimagesSize] = useState(window.innerWidth * (10 / 100))
    function changeImageSize() {
        setimagesSize(window.innerWidth * (10 / 100))
    }

    useEffect(() => {
        changeImageSize();
    });
    window.addEventListener('resize', changeImageSize)
    return (
        <div className="resumecont">
            <TopNav />
            <div className="resumeall">

                <div className="maininfo"></div>
                <div className="otherinfo">
                    <div className="experience">
                        <div className="eximagediv" style={{ width: imagesSize, height: imagesSize }}><img className="eximage" src={Experience}></img></div>
                        <div className="extitle"><h1>Experience</h1></div>

                    </div>
                    <div className="education">education</div>
                </div>

            </div>
            <FooterBar />
        </div>
    )
}
